		["chain heal mouseover target count v2"] = {
			["outline"] = "OUTLINE",
			["fontSize"] = 19,
			["config"] = {
			},
			["authorOptions"] = {
			},
			["displayText"] = "%c",
			["customText"] = "function()\n    local mySpellRange = 40;\n    local jumpRange = 15;\n    local maxTarget = 4;\n    local minHpForCheck = 0.75;\n    \n    local firstTarget = nil;\n    if UnitExists(\"mouseover\") and UnitIsVisible(\"mouseover\") and not UnitIsDeadOrGhost(\"mouseover\") and UnitIsFriend(\"player\",\"mouseover\") and not UnitInVehicle(\"mouseover\") then\n        firstTarget = \"mouseover\"\n    end\n    if firstTarget == nil then\n        return \"no mouseover\"\n    end\n    \n    distanceToFirstTarget = select(1, UnitDistanceSquared(firstTarget))\n    if distanceToFirstTarget^(0.5) > mySpellRange then\n        return \"mouseover not in range\"\n    end\n    \n    local chainHealTargets = 1;\n    \n    local playersWithHealingChain = {};\n    local currentUnit = firstTarget;\n    local jumps = 1;\n    \n    local maxChecks = 20;\n    local checksDone = 0;\n    local jumpChain = UnitName(firstTarget);\n    while(checksDone < maxChecks) do\n        if chainHealTargets == maxTarget then \n            break\n        end\n        local unit = nil\n        local grouptype = nil\n        local nps = 0\n        local npe = 0\n        local lowestHPInRange  = minHpForCheck\n        local lowestHPInRangeUnit  = nil\n        if IsInRaid() then\n            grouptype = \"raid\"\n            nps = 1\n            npe = GetNumGroupMembers()\n        else\n            grouptype = \"party\"\n            nps = 0\n            npe = GetNumSubgroupMembers()\n        end\n        for i=nps,npe do\n            if jumps == maxTarget then break end\n            if i==0 then\n                unit = \"player\"\n            else\n                unit = grouptype..i\n            end\n            if UnitExists(unit) then \n                local guid = UnitGUID(unit)\n                \n                if not UnitIsUnit(unit, currentUnit) and not playersWithHealingChain[guid] then\n                    \n                    local healthpct = UnitHealth(unit) / UnitHealthMax(unit)\n                    if healthpct < lowestHPInRange then\n                        local ax, ay = UnitPosition(currentUnit)\n                        local bx, by = UnitPosition(unit)\n                        if ax and bx then\n                            local dx = ax - bx\n                            local dy = ay - by\n                            local distance =  (dx * dx + dy * dy) ^ 0.5\n                            if distance <= jumpRange then\n                                lowestHPInRangeUnit = unit;\n                                lowestHPInRange = healthpct;\n                                \n                            end\n                        end\n                    end\n                end\n            end\n        end\n        if lowestHPInRange < minHpForCheck then\n            currentUnit = lowestHPInRangeUnit\n            playersWithHealingChain[UnitGUID(lowestHPInRangeUnit)] = true\n            chainHealTargets = chainHealTargets +1;\n            jumpChain = jumpChain..\">\"..UnitName(currentUnit)\n            jumps = jumps +1;\n        end\n        checksDone = checksDone +1;\n    end\n    return \"Chain Heal Targets: \"..chainHealTargets\nend",
