			["internalVersion"] = 9,
			["selfPoint"] = "BOTTOMLEFT",
			["desc"] = "Announces every single volcanic fail to the party chat, counts them, displays them and lists them up in a chat message at the end of a mythic keystone run. This aura is turned off by default, turn it on in the \"load\" tab by unchecking the \"never\" box. To deactivate the chat messages simply put \"--\" (without the quotation marks) in front of every \"SendChatMessage\"-line within the trigger code in case you maybe wanting to use it again in the future, else you can also delete those lines completely. If you have any questions or suggestions, feel free to add me via battle.net: Falco#2415. Best wishes! :)",
