						["genericShowOn"] = "showOnActive",
						["subeventPrefix"] = "SPELL",
						["custom"] = "function(mainevent, time, subevent, wtf1, sourceGUID, sourceName, sourceFlags, wtf2, destGUID, destName, somenumber, wtf3, spellID, spellName, _, amount, _, _, _, _, _, crit)\n    if mainevent == \"CHALLENGE_MODE_START\" then\n        local player1 = strsplit(\"-\", (UnitName(\"player\")))\n        local player2 = strsplit(\"-\", (UnitName(\"party1\")))\n        local player3 = strsplit(\"-\", (UnitName(\"party2\")))\n        local player4 = strsplit(\"-\", (UnitName(\"party3\")))\n        local player5 = strsplit(\"-\", (UnitName(\"party4\")))\n        WeakAurasSaved['volcanic_hits_table'] = {[player1] = 0, [player2] = 0, [player3] = 0, [player4] = 0, [player5] = 0}\n        WeakAurasSaved['total'] = 0\n    end\n    ---\n    if mainevent == \"COMBAT_LOG_EVENT_UNFILTERED\"\n    and subevent == \"SPELL_DAMAGE\"\n    and spellID == 209862 then\n        WeakAurasSaved['total'] = WeakAurasSaved['total'] + 1\n        local player = strsplit(\"-\", (destName))\n        for k,v in pairs(WeakAurasSaved['volcanic_hits_table']) do\n            if k == player then\n                WeakAurasSaved['volcanic_hits_table'][k] = WeakAurasSaved['volcanic_hits_table'][k] + 1\n            end\n        end\n        SendChatMessage(\"Volcanic hit: \"..player..\" (\"..WeakAurasSaved['volcanic_hits_table'][player]..\"/\"..WeakAurasSaved['total']..\").\", \"PARTY\")\n    end\n    --\n    if mainevent == \"CHALLENGE_MODE_COMPLETED\" then\n        SendChatMessage(\"---------------------------------------------\", \"PARTY\")\n        SendChatMessage(\"Volcanic hits total: \"..WeakAurasSaved['total']..\".\", \"PARTY\")\n        SendChatMessage(\"---------------------------------------------\", \"PARTY\")\n        for k,v in pairs(WeakAurasSaved['volcanic_hits_table']) do\n            SendChatMessage(\"Volcanic hits for \"..k..\": \"..v..\".\", \"PARTY\")\n        end\n        SendChatMessage(\"---------------------------------------------\", \"PARTY\")\n    end\n    --\n    if WeakAurasSaved['total'] ~= nil then\n        return true\n    end\nend",
						["customName"] = "function()\n    local display = \"Volcanic Hits: \"..WeakAurasSaved['total']\n    for k,v in pairs(WeakAurasSaved['volcanic_hits_table']) do\n        display = display..\"\\n\"..k..\": \"..v\n    end\n    return display\nend",
