		["Uldir - Fetid Devourer - Shockwave Stomp BW/DBM"] = {
			["textFlags"] = "None",
			["stacksSize"] = 43,
			["xOffset"] = 0,
			["stacksFlags"] = "None",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["borderColor"] = {
				1, -- [1]
				1, -- [2]
				1, -- [3]
				0.5, -- [4]
			},
			["rotateText"] = "NONE",
			["actions"] = {
				["start"] = {
					["custom"] = "local region = aura_env.region\nlocal bar = region.bar\nlocal width, height = bar:GetSize()\n\n-- handle \"Set Maximum Progress\"\nlocal aura_duration = not aura_env.region.adjustedMax and aura_env.state.duration or aura_env.region.adjustedMax\nlocal aura_expirationTime = aura_env.state.expirationTime\n\nlocal haste = GetHaste(\"player\") / 100\nlocal gcd_duration = 1.5 / (haste + 1)\n\nlocal _,_,latency = GetNetStats()\nlatency = latency / 1000 + aura_env.config.brain_lag\n\n\n-- disc rotation helper\nif aura_env.can_use_spell(17) then\n    -- [[ pre burst ]] ----------------------\n    local preburst_timeline = {\n        [1] = {\n            name = \"radiance\",\n            active = true,\n            duration = 2 / (haste + 1),\n            spellid = 194509,\n            icon = select(3, GetSpellInfo(194509)),\n            charge = 2,\n            sound = [[Interface\\Addons\\WeakAuras\\Media\\Sounds\\RobotBlip.ogg]]\n        },\n        [2] = {\n            name = \"radiance\",\n            active = true,\n            duration = 2 / (haste + 1),\n            spellid = 194509,\n            icon = select(3, GetSpellInfo(194509)),\n            charge = 1,\n            sound = [[Interface\\Addons\\WeakAuras\\Media\\Sounds\\RobotBlip.ogg]]\n        },\n        [3] = {\n            name = \"evangelism\",\n            active = select(4, GetTalentInfo(7, 3, 1)),\n            duration = 1.5 / (haste + 1),\n            spellid = 246287,\n            icon = select(3, GetSpellInfo(246287)),\n            sound = nil\n        },\n        [4] = {\n            name = \"shadowfiend\",\n            active = not select(4, GetTalentInfo(3, 2, 1)),\n            duration = gcd_duration,\n            spellid = 34433,\n            icon = select(3, GetSpellInfo(34433)),\n            sound = nil\n        },\n        [5] = {\n            name = \"mindbender\",\n            active = select(4, GetTalentInfo(3, 2, 1)),\n            duration = gcd_duration,\n            spellid = 123040,\n            icon = select(3, GetSpellInfo(123040)),\n            sound = nil\n        },\n        [6] = {\n            name = \"schism\",\n            active = select(4, GetTalentInfo(1, 3, 1)),\n            duration = 1.5 / (haste + 1),\n            spellid = 214621,\n            icon = select(3, GetSpellInfo(214621)),\n            charge = nil,\n            sound = nil\n        }\n    }\n    local spells = preburst_timeline\n    if aura_env.config.consider_latency then\n        for i=1,#spells do\n            local spell = spells[i]\n            spell.duration = spell.duration + latency\n        end \n    end\n    \n    \n    -- set start & active\n    local start = 0\n    for i=#spells,1,-1 do\n        local spell = spells[i]\n        if spell.active then\n            if aura_env.can_use_spell(spell.spellid, aura_duration + start - spell.duration, spell.charge) then\n                start = start - spell.duration\n            else\n                spell.active = false\n            end\n        end\n        spell.start = start\n    end\n    \n    --setup sounds\n    for _,spell in pairs(spells) do\n        if spell.active and spell.sound then\n            local soundfile = spell.sound\n            local timer = aura_duration + spell.start\n            if timer > 0 then\n                C_Timer.After(\n                    timer, \n                    function() PlaySoundFile(soundfile, \"master\") end\n                )\n            end\n        end\n    end\n    \n    \n    -- add icons to progressbar\n    for i=1,#preburst_timeline do\n        local spell = preburst_timeline[i]\n        if spell.active then\n            local icon_size = height * aura_env.config.icon_height_pct\n            local spark_coord_x = (width/aura_duration)*(aura_duration+spell.start)\n            local icon_coord_x = (width/aura_duration)*(aura_duration+spell.start+spell.duration/2)-icon_size/2\n            local spark = bar[\"spark\"..i]\n            if not spark then\n                spark = aura_env.pool:Acquire()\n            end\n            spark:SetTexture([[Interface\\AddOns\\WeakAuras\\Media\\Textures\\Square_White]])\n            spark:SetSize(1, height-4)\n            spark:SetVertexColor(1, 1, 1, 0.2)\n            spark:SetPoint(\"LEFT\", spark_coord_x,0)\n            spark:Show()\n            local icon = bar[\"icon\"..i]\n            if not icon then\n                icon = aura_env.pool:Acquire()\n            end\n            icon:SetSize(icon_size, icon_size)\n            icon:SetTexture(spell.icon)\n            icon:SetAlpha(0.7)\n            icon:SetPoint(\"LEFT\", icon_coord_x, 0)\n            icon:Show()\n        end\n    end\n    \n    return\nend\n\n\nfunction singleCastHelper(spellId, baseTime)\n    local casttime = baseTime/(1+haste/100) + latency\n    if aura_env.can_use_spell(spellId, aura_duration - casttime) then\n        local icon_size = height * aura_env.config.icon_height_pct\n        local spark_coord_x = (width/aura_duration)*(aura_duration-(casttime+latency))\n        local icon_coord_x = (width/aura_duration)*(aura_duration-(casttime+latency)/2)-icon_size/2\n        local spark = bar[\"spark1\"]\n        if not spark then\n            spark = aura_env.pool:Acquire()\n        end\n        spark:SetTexture([[Interface\\AddOns\\WeakAuras\\Media\\Textures\\Square_White]])\n        spark:SetSize(1, height-4)\n        spark:SetVertexColor(1, 1, 1, 0.2)\n        spark:SetPoint(\"LEFT\", spark_coord_x,0)\n        spark:Show()\n        local icon = bar[\"icon1\"]\n        if not icon then\n            icon = aura_env.pool:Acquire()\n        end\n        icon:SetSize(icon_size, icon_size)\n        icon:SetTexture(select(3, GetSpellInfo(spellId)))\n        icon:SetAlpha(0.7)\n        icon:SetPoint(\"LEFT\", icon_coord_x, 0)\n        icon:Show()\n        return\n    end\nend\n\nsingleCastHelper(265202, 2.5) -- Holy Word: Salvation\nsingleCastHelper(123986, 1)   -- Chi Burst\nsingleCastHelper(48438, 1.5)  -- Wild Growth\n\n",
					["do_custom"] = true,
					["sound"] = "Interface\\Addons\\WeakAuras\\PowerAurasMedia\\Sounds\\BITE.ogg",
					["do_sound"] = false,
				},
				["finish"] = {
					["custom"] = "aura_env.pool:ReleaseAll()",
					["do_custom"] = true,
				},
				["init"] = {
					["custom"] = "-- Uldir Burst Timers - 15/09 - https://wago.io/uldir_burst_timers - buds#0500 @ discord\n-- with Disc Burst CastSequence + pre cast helper for monk/druid\n\naura_env.config = {\n    debug = false,\n    consider_latency = true,\n    brain_lag = 0.1,\n    icon_height_pct = 0.8, -- 1 => icon=bar_height, 0.5 => icon=bar_height/2\n}\n\n\nif type(budsPool) ~= \"table\" then\n    budsPool = {}\n    hooksecurefunc(WeakAuras, \"OpenOptions\", function()\n            for k in pairs(budsPool) do\n                budsPool[k]:ReleaseAll()\n            end\n        end\n    )    \nend\nif not budsPool[aura_env.id] then\n    budsPool[aura_env.id] = CreateTexturePool(aura_env.region.bar, \"OVERLAY\")\nend\naura_env.pool = budsPool[aura_env.id]\n\nWeakAuras.WatchGCD()\n\nfunction aura_env.can_use_spell(spellId, time, charge)\n    -- time => check if spell will be ready in x seconds, or now if nill\n    -- charge => number of the charge to check (or nil)\n    if IsSpellKnown(spellId) then\n        if not charge then\n            local started,cd = GetSpellCooldown(spellId)\n            if cd > 0 and cd ~= WeakAuras.gcdDuration() then\n                if time then\n                    return GetTime()+time >= started+cd\n                end\n            else\n                return true\n            end\n        else\n            -- spell with charges\n            local currentCharges, maxCharges, started, cd = GetSpellCharges(spellId)\n            if currentCharges >=  charge then\n                return true\n            else\n                if time then\n                    return (charge - currentCharges) * cd - (GetTime() - started) <= time\n                else\n                    return false\n                end\n            end\n        end\n    end\n    return false\nend\n\nfunction aura_env.countAzeriteTrait(spellId)\n    local count = 0\n    local azeriteItemLocation = C_AzeriteItem.FindActiveAzeriteItem()\n    if (not azeriteItemLocation) then return 0 end\n    \n    local azeritePowerLevel = C_AzeriteItem.GetPowerLevel(azeriteItemLocation)\n    local specID = GetSpecializationInfo(GetSpecialization())\n    \n    for _,slot in next, { 1, 3, 5 } do\n        local item = Item:CreateFromEquipmentSlot(slot)\n        if (not item:IsItemEmpty()) then\n            local itemLocation = item:GetItemLocation()\n            if (C_AzeriteEmpoweredItem.IsAzeriteEmpoweredItem(itemLocation)) then\n                local tierInfo = C_AzeriteEmpoweredItem.GetAllTierInfo(itemLocation)\n                for tier, info in next, tierInfo do\n                    if (info.unlockLevel <= azeritePowerLevel) then\n                        for _, powerID in next, info.azeritePowerIDs do\n                            if C_AzeriteEmpoweredItem.IsPowerSelected(itemLocation, powerID)\n                            and C_AzeriteEmpoweredItem.IsPowerAvailableForSpec(powerID, specID)\n                            then\n                                local powerInfo = C_AzeriteEmpoweredItem.GetPowerInfo(powerID)\n                                --print('powerID', powerID, \"spellID\",powerInfo.spellID)\n                                if powerInfo.spellID == spellId then\n                                    count = count + 1\n                                end\n                            end\n                        end\n                    end\n                end\n            end\n        end\n    end\n    return count\nend\n\n\n\n\n\n\n",
					["do_custom"] = true,
				},
