			},
			["text2"] = "%p",
			["customText"] = "function()\n    if aura_env and aura_env.state then\n        \n        -- make glow frame\n        if not aura_env.region.glow then\n            aura_env.region.glow = CreateFrame(\"Frame\", nil, aura_env.region.bar)\n            aura_env.region.glow:SetFrameStrata(\"DIALOG\")\n        end\n        aura_env.region.glow:SetAllPoints(aura_env.region.icon)\n        \n        if aura_env.state.energyMax > 0 then\n            local pct_energy = aura_env.state.energy / aura_env.state.energyMax * 100\n            local pct_health = aura_env.state.value / aura_env.state.total * 100\n            \n            -- show/hide glow\n            if pct_health < aura_env.glow_minhp or pct_energy > aura_env.glow_minenergy then\n                WeakAuras.ShowOverlayGlow(aura_env.region.glow)\n            else\n                -- should not happen on boss\n                WeakAuras.HideOverlayGlow(aura_env.region.glow)\n            end\n            \n            local b = aura_env.region.bar\n            local bar_width, bar_height = b:GetSize()\n            local energy_height = bar_height/3\n            \n            -- make energy bar\n            if not b.energy then\n                b.energy = b:CreateTexture(nil, 'OVERLAY')\n                b.energy:SetDrawLayer(\"ARTWORK\", 3);\n                b.energy:SetTexture(b.fg:GetTexture())\n                b.energy:SetVertexColor(255, 195, 0)\n                b.energy:SetHeight(energy_height)\n                b.energy:SetBlendMode('BLEND')\n            end\n            \n            -- show energy bar\n            if aura_env.state.energy > 0 then\n                local energy_width = bar_width*(aura_env.state.energy / aura_env.state.energyMax)\n                b.energy:SetWidth(energy_width)\n                b.energy:SetHeight(energy_height)\n                b.energy:ClearAllPoints()\n                b.energy:SetPoint(\"BOTTOMLEFT\", energy_width-bar_width)\n                b.energy:Show()\n            else\n                b.energy:Hide()\n            end\n            \n            -- reduce health bar height\n            local p1 = {b.fg:GetPoint(1)}\n            local p2 = {b.fg:GetPoint(2)}\n            b.fg:ClearAllPoints()\n            b.fg:SetPoint(unpack(p1))\n            b.fg:SetPoint(p2[1],p2[2],p2[3],p2[4],energy_height)\n        end\n    else\n        aura_env.region.bar.energy:Hide()\n    end\nend",
			["justify"] = "CENTER",
