						["custom"] = "function(allstates, event, unit, ...)\n    if event == \"NAME_PLATE_UNIT_ADDED\" and unit then\n        local GUID = UnitGUID(unit)\n        local npcID = select(6, strsplit(\"-\", GUID))\n        if tonumber(npcID) == 135083 or aura_env.debug then\n            allstates[unit] = {\n                name = UnitName(unit),\n                unit = unit,\n                value = UnitHealth(unit),\n                total = UnitHealthMax(unit),\n                energy = UnitPower(unit),\n                energyMax = UnitPowerMax(unit),\n                progressType = \"static\",\n                changed = true,\n                show = true,\n            }\n        end\n        \n    elseif event == \"NAME_PLATE_UNIT_REMOVED\" then\n        if allstates[unit] then\n            allstates[unit].show = false\n            allstates[unit].changed = true\n        end\n    end\n    \n    if event == \"UNIT_POWER_FREQUENT\" then --or _UPDATE ??\n        if allstates[unit] then\n            allstates[unit].energy = UnitPower(unit)\n            allstates[unit].changed = true\n        end\n    end\n    if event == \"UNIT_HEALTH_FREQUENT\" then\n        if allstates[unit] then\n            allstates[unit].value = UnitHealth(unit)\n            allstates[unit].changed = true\n        end\n    end\n    return true\nend",
