        Y = 0 - (distance * test)\n                        end\n                    elseif aura_env.orientation == 4 then --FROM BOTTOM TO TOP\n                        local side = (aura_env.side == \"LEFT\" or aura_env.side == \"RIGHT\") and aura_env.side or \"RIGHT\"\n                        if side == \"LEFT\" then\n                            X = 0 - (distance)\n                            Y = 0 + (distance * test)\n                        elseif side == \"RIGHT\" then\n                            X = 0 + (distance)\n                            Y = 0 + (distance * test)\n                        end\n                    end\n                    \n                    \n                    region:ClearAllPoints()\n                    region:SetPoint(\"CENTER\" , WeakAuras.regions[aura_env.id].region, \"CENTER\", X, Y)\n                    \n                    if aura_env.showTooltips then\n                        region:SetScript(\"OnEnter\", function() GameTooltip:SetOwner(UIParent, \"ANCHOR_CURSOR\")\n                                if region.state.link then\n                                    GameTooltip:SetHyperlink(region.state.link)\n                                else\n                                    GameTooltip:AddDoubleLine(region.state.name, region.state.spellid, 1, 1, 1, 1, 1, 1)\n                                end\n                                GameTooltip:AddLine(region.state.description, nil, nil, nil, true)\n                                GameTooltip:Show()\n                        end)\n                        region:SetScript(\"OnLeave\", function() GameTooltip:Hide() end)\n                    end\n                    \n                    tc[region.state.itemSlot] = {}\n                    list[region.state.itemSlot] = 2\n                    local point, relativeTo, relativePoint, xOfs, yOfs = region:GetPoint()\n                    tc[region.state.itemSlot] = {point, relativeTo, relativePoint, xOfs, yOfs}\n                    test = test + 1\n                elseif region.state.relativeTo and list[region.state.relativeTo] then\n                    local point, relativeTo, relativePoint, xOfs, yOfs = unpack(tc[region.state.relativeTo])\n                    \n                    if aura_env.orientation == 1 or aura_env.orientation == 2 then --from RIGHT to LEFT\n                        local side = (aura_env.side == \"TOP\" or aura_env.side == \"BOTTOM\") and aura_env.side or \"TOP\"\n                        if side == \"TOP\" then\n                            yOfs = 0 + (distance * list[region.state.relativeTo])\n                        elseif side == \"BOTTOM\" then\n                            yOfs = 0 - (distance * list[region.state.relativeTo])\n                        end\n                    elseif aura_env.orientation == 3 or aura_env.orientation == 4 then --FROM TOP to BOTTOM\n                        local side = (aura_env.side == \"LEFT\" or aura_env.side == \"RIGHT\") and aura_env.side or \"RIGHT\"\n                        if side == \"LEFT\" then\n                            xOfs = 0 - (distance * list[region.state.relativeTo])\n                        elseif side == \"RIGHT\" then\n                            xOfs = 0 + (distance * list[region.state.relativeTo])\n                        end\n                    end\n                    \n                    region:ClearAllPoints()\n                    region:SetPoint(point, relativeTo, relativePoint, xOfs, yOfs)\n                    \n                    if aura_env.showTooltips then\n                        region:SetScript(\"OnEnter\", function() GameTooltip:SetOwner(UIParent, \"ANCHOR_CURSOR\")\n                                GameTooltip:AddDoubleLine(region.state.name, region.state.spellid, 1, 1, 1, 1, 1, 1)\n                                GameTooltip:AddLine(region.state.description, nil, nil, nil, true)\n                                GameTooltip:Show()\n                        end)\n                        region:SetScript(\"OnLeave\", function() GameTooltip:Hide() end)\n                    end\n                    \n                    list[region.state.relativeTo] = list[region.state.relativeTo] + 1\n                else\n                    region:ClearAllPoints()\n                    region:SetPoint(\"CENTER\" , WeakAuras.regions[aura_env.id].region, \"CENTER\", xOffset, yOffset)\n                    \n                    if aura_env.showTooltips then\n                        region:SetScript(\"OnEnter\", function() GameTooltip:SetOwner(UIParent, \"ANCHOR_CURSOR\")\n                                if region.state.link then\n                                    GameTooltip:SetHyperlink(region.state.link)\n                                else\n                                    GameTooltip:AddDoubleLine(region.state.name, region.state.spellid, 1, 1, 1, 1, 1, 1)\n                                end\n                                GameTooltip:AddLine(region.state.description, nil, nil, nil, true)\n                                GameTooltip:Show()\n                        end)\n                        region:SetScript(\"OnLeave\", function() GameTooltip:Hide() end)\n                    end\n                    \n                    count = count + 1\n                end\n            else --NORMAL MODE\n                local xOffset, yOffset = 0, 0\n                local distance = region.width + spacing\n                if aura_env.orientation == 1 then --from RIGHT to LEFT\n                    xOffset = 0 - (distance * count)\n                    \n                elseif aura_env.orientation == 2 then --from LEFT to RIGHT\n                    xOffset = 0 + (distance * count)\n                    \n                elseif aura_env.orientation == 3 then --FROM TOP to BOTTOM\n                    yOffset = 0 - (distance * count)\n                    \n                elseif aura_env.orientation == 4 then --FROM BOTTOM to TOP\n                    yOffset = 0 + (distance * count)\n                end\n                \n                if region.state.itemSlot and not tc[region.state.itemSlot] then\n                    region:ClearAllPoints()\n                    region:SetPoint(\"CENTER\" , WeakAuras.regions[aura_env.id].region, \"CENTER\", xOffset, yOffset)\n                    \n                    if aura_env.showTooltips then\n                        region:SetScript(\"OnEnter\", function() GameTooltip:SetOwner(UIParent, \"ANCHOR_CURSOR\")\n                                if region.state.link then\n                                    GameTooltip:SetHyperlink(region.state.link)\n                                else\n                                    GameTooltip:AddDoubleLine(region.state.name, region.state.spellid, 1, 1, 1, 1, 1, 1)\n                                end\n                                GameTooltip:AddLine(region.state.description, nil, nil, nil, true)\n                                GameTooltip:Show()\n                        end)\n                        region:SetScript(\"OnLeave\", function() GameTooltip:Hide() end)\n                    end\n                    \n                    tc[region.state.itemSlot] = {}\n                    list[region.state.itemSlot] = 1\n                    local point, relativeTo, relativePoint, xOfs, yOfs = region:GetPoint()\n                    tc[region.state.itemSlot] = {point, relativeTo, relativePoint, xOfs, yOfs}\n                    count = count + 1\n                elseif region.state.relativeTo and list[region.state.relativeTo] then\n                    local point, relativeTo, relativePoint, xOfs, yOfs = unpack(tc[region.state.relativeTo])\n                    \n                    if aura_env.orientation == 1 or aura_env.orientation == 2 then --from RIGHT to LEFT\n                        local side = (aura_env.side == \"TOP\" or aura_env.side == \"BOTTOM\") and aura_env.side or \"TOP\"\n                        if side == \"TOP\" then\n                            yOfs = 0 + (distance * list[region.state.relativeTo])\n                        elseif side == \"BOTTOM\" then\n                            yOfs = 0 - (distance * list[region.state.relativeTo])\n                        end\n                    elseif aura_env.orientation == 3 or aura_env.orientation == 4 then --FROM TOP to BOTTOM\n                        local side = (aura_env.side == \"LEFT\" or aura_env.side == \"RIGHT\") and aura_env.side or \"RIGHT\"\n                        if side == \"LEFT\" then\n                            xOfs = 0 - (distance * list[region.state.relativeTo])\n                        elseif side == \"RIGHT\" then\n                            xOfs = 0 + (distance * list[region.state.relativeTo])\n                        end\n                    end\n                    \n                    region:ClearAllPoints()\n                    region:SetPoint(point, relativeTo, relativePoint, xOfs, yOfs)\n                    \n                    if aura_env.showTooltips then\n                        region:SetScript(\"OnEnter\", function() GameTooltip:SetOwner(UIParent, \"ANCHOR_CURSOR\")\n                                GameTooltip:AddDoubleLine(region.state.name, region.state.spellid, 1, 1, 1, 1, 1, 1)\n                                GameTooltip:AddLine(region.state.description, nil, nil, nil, true)\n                                GameTooltip:Show()\n                        end)\n                        region:SetScript(\"OnLeave\", function() GameTooltip:Hide() end)\n                    end\n                    \n                    list[region.state.relativeTo] = list[region.state.relativeTo] + 1\n                else\n                    region:ClearAllPoints()\n                    region:SetPoint(\"CENTER\" , WeakAuras.regions[aura_env.id].region, \"CENTER\", xOffset, yOffset)\n                    \n                    if aura_env.showTooltips then\n                        region:SetScript(\"OnEnter\", function() GameTooltip:SetOwner(UIParent, \"ANCHOR_CURSOR\")\n                                if region.state.link then\n                                    GameTooltip:SetHyperlink(region.state.link)\n                                else\n                                    GameTooltip:AddDoubleLine(region.state.name, region.state.spellid, 1, 1, 1, 1, 1, 1)\n                                end\n                                GameTooltip:AddLine(region.state.description, nil, nil, nil, true)\n                                GameTooltip:Show()\n                        end)\n                        region:SetScript(\"OnLeave\", function() GameTooltip:Hide() end)\n                    end\n                    \n                    count = count + 1\n                end\n            end\n            \n        end\n    end\nend\n\n\n\n-------------- GLOWING ---------------\nlocal AutoCastShineParentFrame = CreateFrame(\"Frame\")\n\nlocal AutoCastShineTexPool = CreateTexturePool(AutoCastShineParentFrame ,\"ARTWORK\",7)\nlocal FramePoolResetter = function(framePool,frame)\n    frame:SetScript(\"OnUpdate\",nil)\n    local parent = frame:GetParent()\n    if parent.ACShine then\n        parent.ACShine = nil\n        --frame:SetParent(AutoCastShineParentFrame)\n    end\n    if frame.sparkles then\n        for index, sparkle in pairs(frame.sparkles) do\n            AutoCastShineTexPool:Release(sparkle)\n        end\n    end\n    frame.sparkles = {}\n    frame.timers = {0,0,0,0}\n    frame:Hide()\n    frame:ClearAllPoints()\nend\nlocal AutoCastShineFramePool = CreateFramePool(\"Frame\",AutoCastShineParentFrame,nil,FramePoolResetter)\n\n\nlocal ACShine_OnUpdate = function(self,elapsed)\n    local width,height = self:GetSize()\n    local perimeter = 2*(width+height)\n    local bottomlim = height*2+width\n    local rightlim = height+width\n    local space = perimeter/self.N\n    for k,timer in pairs(self.timers) do\n        self.timers[k] = timer+elapsed\n        if timer > self.period*k then\n            timer = timer%(self.period*k)\n        end\n        for i=1,self.N do\n            local pN = i+self.N*(k-1)\n            local position = (space*i+perimeter*timer/(self.period*k))%perimeter\n            if position>bottomlim then\n                self.sparkles[pN]: SetPoint(\"CENTER\",self,\"BOTTOMRIGHT\",-position+bottomlim,0)\n            elseif position>rightlim then\n                self.sparkles[pN]: SetPoint(\"CENTER\",self,\"TOPRIGHT\",0,-position+rightlim)\n            elseif position>height then\n                self.sparkles[pN]: SetPoint(\"CENTER\",self,\"TOPLEFT\",position-height,0)\n            else\n                self.sparkles[pN]: SetPoint(\"CENTER\",self,\"BOTTOMLEFT\",0,position)\n            end\n        end\n    end\nend\n\nACShine_Start = function(region,r,g,b,N,period,scale)\n    r = r or 0.95\n    g = g or 0.95\n    b = b or 0.32\n    if N then\n        if not(N>0) then\n            N = 4\n        end\n    else\n        N = 4\n    end\n    \n    scale = scale or 1\n    \n    if not region.ACShine then\n        local frame,new =  AutoCastShineFramePool:Acquire()\n        if new then\n            frame.sparkles = {}\n            frame.timers = {0,0,0,0}\n        end\n        region.ACShine = frame\n    end\n    local f = region.ACShine\n    f:SetParent(region)\n    f:SetFrameLevel(region:GetFrameLevel()+4)\n    f:SetAllPoints(region)\n    f:Show()\n    \n    local width,height = f:GetSize();\n    local space =  2*(width+height)/N\n    local sizes ={13,10,7,4}\n    \n    if period then\n        if not(period>0.4) then\n            period = 8\n        end\n    else\n        period = 8\n    end\n    \n    \n    for k,size in pairs(sizes) do\n        for i = 1,N do\n            local pN = i+(k-1)*N\n            if not f.sparkles[pN] then\n                local sparkle,new = AutoCastShineTexPool:Acquire()\n                if new then\n                    sparkle:SetTexture(\"Interface\\\\Challenges\\\\challenges-metalglow\")\n                    sparkle: SetDesaturated(true)\n                    sparkle:SetBlendMode(\"ADD\")\n                end\n                f.sparkles[pN] = sparkle\n                f.sparkles[pN]:SetParent(f)\n            end\n            f.sparkles[pN]: SetSize(size*scale,size*scale)\n            f.sparkles[pN]: SetVertexColor(r,g,b)\n            f.sparkles[pN]:Show()\n        end\n    end\n    \n    while #f.sparkles>N*4 do\n        AutoCastShineTexPool:Release(f.sparkles[#f.sparkles])\n        table.remove(f.sparkles)        \n    end\n    \n    f.N = N\n    f.period = period\n    f: SetScript(\"OnUpdate\",ACShine_OnUpdate)\nend\n\nACShine_Stop = function(region)\n    if not region.ACShine then\n        return false\n    end\n    AutoCastShineFramePool:Release(region.ACShine)\n    return true\nend\n\n\nhooksecurefunc(WeakAuras, \"OpenOptions\", function()\n        AutoCastShineFramePool:ReleaseAll()\nend)\n\n",
