			["customText"] = "function()\n    aura_env.timer = aura_env.timer or 0\n    if GetTime() >= aura_env.timer+0.3 then\n        aura_env.timer = GetTime()\n        local timer = 0\n        aura_env.result = \"\"\n        if select(4, GetInstanceInfo()) == \"Mythic\" then timer = 120 else timer = 180 end\n        for i = 1,3 do\n            if aura_env.time[i] ~= 0 then\n                local timer1 = aura_env.round(timer-(GetTime()-aura_env.time[i]),0)\n                local color = \"|cFFFFFFFF\"\n                if timer1 < 0 then timer1 = 0 end\n                if timer1 > 60 then color = \"|cFF00FF00\"\n                elseif timer1 > 20 then color = \"|cFFFFA500\"\n                elseif timer1 > 0 then color = \"|cFFFF0000\"\n                else color = \"|cFFFFFFFF\" end\n                if timer1 == 0 then\n                    aura_env.result = aura_env.result..\"|cFFFFFFFF Room \"..i..\": DONE\\n\"\n                else\n                    aura_env.result = aura_env.result..\"|cFFFFFFFF Room \"..i..\": \"..color..timer1..\"\\n\"\n                end\n            end\n        end\n        \n    end\n    return aura_env.result\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
