				["init"] = {
					["custom"] = "aura_env.count = 0\naura_env.team = 1\naura_env.sent = false\naura_env.next = false\naura_env.time = 0\naura_env.debuff = 263372\naura_env.groups = \n{\n    [1] = {\n        [1] = \"Spazpriest\", \n        [2] = \"Scuffedsp\",\n        [3] = \"Reeceburton\", \n        [4] = \"Kbrews\",\n    },\n    [2] = {\n        [1] = \"Ginsu\", \n        [2] = \"Buffww\",\n        [3] = \"Valdurachi\", \n        [4] = \"Seor\",\n    },\n    [3] = {\n        [1] = \"Niseko\", \n        [2] = \"Tigerozy\",\n        [3] = \"Buffww\", \n        [4] = \"empty\",\n    },\n    [4] = {\n        [1] = \"Niseko\", \n        [2] = \"Ginsu\",\n        [3] = \"Gubbyhunter\", \n        [4] = \"Calekk\",\n    },\n    [5] = {\n        [1] = \"Naiil\", \n        [2] = \"Guppylock\",\n        [3] = \"Nâte\", \n        [4] = \"Ginsu\",\n    },\n    [10] = {\n        [1] = \"empty\", \n        [2] = \"empty\", \n        [3] = \"empty\", \n        [4] = \"empty\", \n    },\n}\n\n\nfor j = 6,9 do\n    aura_env.groups[j] = {}\n    for i= 1,4 do\n        aura_env.groups[j][i] = aura_env.groups[j-5][i]\n    end\nend\n\naura_env.runner = {}\n\nfor j = 1,9 do\n    for i = 2, 4, 2 do\n        aura_env.runner[aura_env.groups[j][i]] = true\n    end\nend\n\n\naura_env.round = function(num, idp)\n    local mult = 10^(idp or 0)\n    return math.floor(num * mult + 0.5) / mult\nend\n\n\n\n\n\n\n\n",
