						["custom"] = "function(e, ...) \n    \n    --[[\n    Returns 1 if player is inside instance and player is in a party.\n    Returns 2 if player is inside instance and player is in not in a party (is in a raid).\n    Returns 3 if player is not inside instance.\n    ]]\n    local function instanceCheck()\n        local instanced, instanceType = IsInInstance()\n        if instanced then\n            if instanceType == \"party\" then\n                return 1\n            else\n                return 2\n            end\n        end\n        return 0\n    end\n    \n    -- add comma to separate thousands\n    -- \n    local function comma_value(amount)\n        local formatted = amount\n        while true do  \n            formatted, k = string.gsub(formatted, \"^(-?%d+)(%d%d%d)\", '%1,%2')\n            if (k==0) then\n                break\n            end\n        end\n        return formatted\n    end\n    \n    if e == \"ENCOUNTER_START\" then\n        if instanceCheck() == 2 then\n            --print(\"RootsEstimation: Boss Encounter has Begun.\")\n            if CBT_Total ~=0 then\n                CBT_Reset = CBT_Total\n                CBT_Total= 0\n            end\n        end\n    elseif  e == \"ENCOUNTER_END\" then\n        if instanceCheck() == 2 then\n            --print(\"RootsEstimation: Boss Encounter has Ended.\")\n            print(\"Total Roots feeding: \"..comma_value(math.floor(CBT_Total)))\n        end\n    end\nend",
