						["subeventSuffix"] = "_CAST_START",
						["check"] = "update",
						["custom"] = "function()\n    -- Essence Font target counter\n    -- Original code by Clebane. Modified by Garg & Raysere\n    -- Revision 3\n    -- Last modified 22 July 2016 by Raysere\n    \n    local target_threshold = 6 -- Number of injured targets in range before aura will show\n    local spell_radius = 25 --Radius in yards of Essence Font\n    \n    WA_rangecheck_global =  WA_rangecheck_global or GetTime()\n    \n    --Only run if it's been > 1 second since the last time we ran\n    if GetTime() - WA_rangecheck_global > 1 then\n        \n        WA_rangecheck_global = GetTime()\n        \n        if IsInGroup() then\n            \n            WA_rangecheckcount_global = 0\n            \n            local grouptype = (IsInRaid() and 'raid') or (IsInGroup() and 'party')\n            \n            --Check if player should be counted as viable target\n            --Doing this separately because of awkward difference between party and raid UIDs\n            if UnitHealth('player') < UnitHealthMax('player') then\n                WA_rangecheckcount_global = WA_rangecheckcount_global +1\n            end\n            \n            --Iterate over group members, check their range, make sure they are not the player, then check if injured and increment count if so.\n            for i = 1,GetNumGroupMembers() do\n                \n                local dist = math.sqrt(UnitDistanceSquared(grouptype..i))\n                \n                if not UnitIsUnit(grouptype..i, 'player') and dist <= spell_radius then\n                    \n                    if UnitHealth(grouptype..i) < UnitHealthMax(grouptype..i) then\n                        \n                        WA_rangecheckcount_global = WA_rangecheckcount_global + 1\n                        \n                        \n                    end\n                end\n            end\n            \n            if WA_rangecheckcount_global >= target_threshold then\n                return true\n            end\n        end\n    end\nend",
						["event"] = "Health",
						["custom_hide"] = "timed",
					},
					["untrigger"] = {
