			["customText"] = "function(event,...)\n    if WeakAuras.IsOptionsOpen() then\n        return \"|TInterface\\\\Icons\\\\Ability_titankeeper_cleansingorb:0:0:0|t\".. WA_ClassColorName(\"player\") .. \"|TInterface\\\\Icons\\\\Spell_warlock_demonicportal_green:0:0:0|t|TInterface\\\\RaidFrame\\\\ReadyCheck-Ready:0:0:0|t\\n|TInterface\\\\Icons\\\\Ability_titankeeper_cleansingorb:0:0:0|t\".. WA_ClassColorName(\"player\") .. \"|TInterface\\\\Icons\\\\Spell_warlock_demonicportal_green:0:0:0|t|TInterface\\\\RaidFrame\\\\ReadyCheck-Ready:0:0:0|t\"\n        \n    end\n    local ret = \"\"\n    for unit in WA_IterateGroupMembers() do\n        if WA_GetUnitDebuff(unit, \"Power Matrix\") then\n            local re = \"\"\n            local one = \"\"\n            local two = \"\"\n            local three = \"\"\n            local four = \"\"\n            local one = \"|c\" .. RAID_CLASS_COLORS[select(2, UnitClass(unit))].colorStr .. UnitName(unit):sub(1,6) .. \"|r\" \n            three = \"|TInterface\\\\Icons\\\\Ability_titankeeper_cleansingorb:0:0:0:-14|t\" \n            if WA_GetUnitDebuff(unit, \"Demonic Gateway\") then\n                two = \"|TInterface\\\\Icons\\\\Spell_warlock_demonicportal_green:0:0:0:-14|t\"\n                \n            end\n            if select(1,UnitCastingInfo(unit)) == \"Deposit Power Matrix\" then\n                four = \"|TInterface\\\\RaidFrame\\\\ReadyCheck-Ready:0:0:0:-14|t\"\n            end\n            if UnitName(unit) == aura_env.f then\n                \n                re = three .. aura_env.g .. two .. four ..\"\\n\"\n                ret = ret .. re\n            else\n                \n                re = three .. one .. two .. four ..\"\\n\"\n                ret = ret .. re\n                \n            end\n        end\n        \n    end\n    return ret\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
